import React from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";
export default function Footer() {
  return (
    <>
      <FooterWrapper>
        <FooterContainer>
          <FooterUP>
            <div>Log</div>
            <FooterLinks>
              <LinksWrapper>
                <strong>Resources</strong>
                <FLinks>Blog</FLinks>
                <FLinks>Experts</FLinks>
              </LinksWrapper>
              <LinksWrapper>
                <strong>Learn</strong>
                <FLinks>Python</FLinks>
                <FLinks>Data Analysis</FLinks>
              </LinksWrapper>
            </FooterLinks>
          </FooterUP>
          <FooterDOWN></FooterDOWN>
        </FooterContainer>
      </FooterWrapper>
    </>
  );
}

const FooterWrapper = styled.div`
  background-color: #040e18;
`;

const FooterContainer = styled.div`
  /* background-color: #fff; */
  margin: 0 auto;
  width: 1172px;
`;
const FooterUP = styled.div`
  display: flex;
`;
const FooterLinks = styled.div`
  display: flex;
`;
const LinksWrapper = styled.div`
  display: flex;
  flex-direction: column;
  text-align: left;
  padding: 0 28px;

  strong {
    text-transform: uppercase;
    font-size: 16px;
    padding-bottom: 16px;
    padding-top: 36px;
    color: #fff;
  }
`;
const FLinks = styled(Link)`
  color: #fff;
  padding: 9px 0;
  opacity: 0.75;
`;
const FooterDOWN = styled.div``;
